import React, {useState} from 'react';
import axios from 'axios';

function App() {
    const franchiseData = [];
    async function fetchData() {
        try {
          const res = await axios.get('http://localhost:3000/api/products');
          franchiseData.push(...res.data.products);
        } catch (error) {
          console.error('Error fetching data:', error.message);
        }
      }
      fetchData();
      console.log(franchiseData);
      function printBusinessSignsByIndustry(industry) {
        const matchingSigns = [];

        for (const key in franchiseData) {
          if (franchiseData.hasOwnProperty(key)) {
            const item = franchiseData[key];
            if (item.업종 === industry) {
              matchingSigns.push(item.영업표지);
            }
          }
        }

        console.log(matchingSigns);
      }

      // "원하는 업종"에 해당하는 모든 영업표지 출력
      printBusinessSignsByIndustry('일식');

